*.host19.app[0].io.destAddress = "host12"
*.host19.app[0].source.packetNameFormat = "%M-%m-%c"
*.host19.app[0].source.displayStringTextFormat = "sent %p pk (%l)"
*.host19.app[0].source.packetLength = 13B
*.host19.app[0].source.productionInterval = 100us
*.host19.app[0].display-name = "type2_16"
*.host19.app[0].io.destPort = 1000

*.host12.numApps = 1
*.host12.app[0].typename = "UdpSinkApp"
*.host12.app[0].io.localPort = 1000

# seamless stream redundancy configuration
*.streamRedundancyConfigurator.configuration = [
    {
        name: "shortest_path", 
        packetFilter: "*-type2_16-*", 
        source: "host19", 
        destination: "host12",
        trees: [[["host19", "switch19", "switch12", "host12"]]]
    }]
